export interface StorageKey {
    region: number;
    regionKey: string;
    gameId?: string;
    userId?: string;
}
export interface StorageValue {
    data: string | number;
    tag?: string;
    storageKey?: StorageKey;
}
export interface StorageReadKey extends StorageKey {
    options?: {
        keyOrder?: number;
        valueOrder?: number;
    };
}
export interface StorageData {
    readKey: StorageReadKey;
    values: StorageValue[];
}
